// components/NyArtikkel.js
import React, { useState } from 'react';
import { Navigate } from 'react-router-dom';
import './NyArtikkel.css';

function NyArtikkel({ innloggetBruker, onLeggTilArtikkel, kategoriliste = [] }) {
  const [tittel, setTittel] = useState('');
  const [ingress, setIngress] = useState('');
  const [innhold, setInnhold] = useState('');
  const [kategori, setKategori] = useState('');
  const [bildeForhåndsvisning, setBildeForhåndsvisning] = useState(null);
  const [bildeData, setBildeData] = useState(null);
  const [melding, setMelding] = useState('');
  const [feilmelding, setFeilmelding] = useState('');
  const [redirect, setRedirect] = useState(false);
  const [artikkelID, setArtikkelID] = useState(null);

  // Sjekk om brukeren er logget inn
  if (!innloggetBruker) {
    return <Navigate to="/innlogging" replace />;
  }

  // Håndterer opplasting av bilde
  const handleBildeEndring = (e) => {
    const fil = e.target.files[0];
    if (fil) {
      const leser = new FileReader();
      leser.onloadend = () => {
        setBildeForhåndsvisning(leser.result);
        setBildeData(leser.result);
      };
      leser.readAsDataURL(fil);
    }
  };

  // Fjerner bilde
  const fjernBilde = () => {
    setBildeForhåndsvisning(null);
    setBildeData(null);
  };

  // Håndterer innsending av skjema
  const handleSubmit = (e) => {
    e.preventDefault();

    // Validering
    if (!tittel.trim() || !ingress.trim() || !innhold.trim() || !kategori) {
      setFeilmelding('Alle feltene må fylles ut');
      return;
    }

    // Opprett artikkel-objekt
    const nyArtikkel = {
      tittel,
      ingress,
      innhold,
      kategori,
      bilde: bildeData
    };

    // Legg til artikkel
    const id = onLeggTilArtikkel(nyArtikkel);

    if (id) {
      setMelding('Artikkel opprettet! ' + (innloggetBruker.rolle === 'admin' ? 'Artikkelen er publisert.' : 'Artikkelen venter på godkjenning.'));
      setArtikkelID(id);

      // Tøm skjema
      setTittel('');
      setIngress('');
      setInnhold('');
      setKategori('');
      setBildeForhåndsvisning(null);
      setBildeData(null);

      // Redirect etter 2 sekunder
      setTimeout(() => {
        setRedirect(true);
      }, 2000);
    } else {
      setFeilmelding('Noe gikk galt ved oppretting av artikkel');
    }
  };

  // Redirect til artikkelen
  if (redirect && artikkelID) {
    return <Navigate to={`/artikkel/${artikkelID}`} replace />;
  }

  return (
    <div className="ny-artikkel">
      <h2>Skriv ny artikkel</h2>

      {melding && <div className="melding-boks">{melding}</div>}
      {feilmelding && <div className="feilmelding">{feilmelding}</div>}

      <form onSubmit={handleSubmit}>
        <div className="form-gruppe">
          <label htmlFor="tittel">Tittel:</label>
          <input 
            type="text" 
            id="tittel" 
            value={tittel} 
            onChange={(e) => setTittel(e.target.value)} 
            required 
          />
        </div>

        <div className="form-gruppe">
          <label htmlFor="ingress">Ingress:</label>
          <textarea 
            id="ingress" 
            value={ingress} 
            onChange={(e) => setIngress(e.target.value)} 
            required 
          />
        </div>

        <div className="form-gruppe">
          <label htmlFor="innhold">Innhold:</label>
          <textarea 
            id="innhold" 
            value={innhold} 
            onChange={(e) => setInnhold(e.target.value)} 
            required 
            rows="10"
          />
        </div>

        <div className="form-gruppe">
          <label htmlFor="kategori">Kategori:</label>
          <select 
            id="kategori" 
            value={kategori} 
            onChange={(e) => setKategori(e.target.value)} 
            required
          >
            <option value="">Velg kategori</option>
            {kategoriliste.map(kat => (
              <option key={kat.id} value={kat.kategori}>
                {kat.kategori}
              </option>
            ))}
          </select>
        </div>

        <div className="form-gruppe">
          <label htmlFor="bilde">Bilde:</label>
          <input 
            type="file" 
            id="bilde" 
            accept="image/*" 
            onChange={handleBildeEndring} 
          />

          {bildeForhåndsvisning && (
            <div className="bilde-forhåndsvisning">
              <img src={bildeForhåndsvisning} alt="Forhåndsvisning" />
              <button type="button" onClick={fjernBilde} className="fjern-bilde">
                Fjern bilde
              </button>
            </div>
          )}
        </div>

        <div className="form-gruppe">
          <p className="info-tekst">
            {innloggetBruker.rolle === 'admin' 
              ? 'Som administrator vil artikkelen din publiseres umiddelbart.' 
              : 'Artikkelen din må godkjennes av en administrator før den publiseres.'}
          </p>
        </div>

        <button type="submit" className="send-knapp">
          Send inn artikkel
        </button>
      </form>
    </div>
  );
}

export default NyArtikkel;
